import React from "react";
import {Col, Row} from "antd";

import {Area, AreaChart, Line, LineChart, ResponsiveContainer, Tooltip} from "recharts";
import {increamentData, lineData} from "../../Metrics/data";
import ChartCard from "components/dashboard/Crypto/ChartCard";
import Auxiliary from "util/Auxiliary";
import Portfolio from "components/dashboard/Crypto/Portfolio";
import BalanceHistory from "components/dashboard/Crypto/BalanceHistory";
import SendMoney from "components/dashboard/Crypto/SendMoney";
import RewardCard from "components/dashboard/Crypto/RewardCard";
import WelComeCard from "components/dashboard/CRM/WelComeCard";
import SiteAudience from "components/dashboard/CRM/SiteAudience";
import SiteVisit from "components/dashboard/CRM/SiteVisit";

const Crypto = () => {
  return (
    <Auxiliary>
      <Row>
      <Col span={24}>
          <div className="gx-card">
            <div className="gx-card-body">
              <Row>
                <Col xl={6} lg={12} md={12} sm={12} xs={24}>
                  <WelComeCard/>
                </Col>

                <Col xl={6} lg={12} md={12} sm={12} xs={24} className="gx-audi-col">
                  <SiteAudience/>
                </Col>

                <Col xl={12} lg={24} md={24} sm={24} xs={24} className="gx-visit-col">
                  <SiteVisit/>
                </Col>
              </Row>
            </div>
          </div>
        </Col>
   
        <Col xl={12} lg={24} md={12} sm={24} xs={24}>
          <Portfolio/>
        </Col>
        <Col xl={12} lg={24} md={12} sm={24} xs={24}>
          <BalanceHistory/>
        </Col>

        <Col xl={9} lg={24} md={24} sm={24} xs={24}>
          <SendMoney/>
        </Col>
        <Col xl={6} lg={12} md={12} sm={24} xs={24}>
          <RewardCard/>
        </Col>
        <Col xl={9} lg={12} md={12} sm={24} xs={24}>
        <SendMoney/>
        </Col>        
      </Row>

    </Auxiliary>
  );
};

export default Crypto;
